EditarExp=function(a){$.ajax({type:"POST",data:{user_id:a,acao:"load_expiracao"},dataType:"json",url:"./ajax/ajax_load.php",beforeSend:function(){$("#loading2").modal("show")},success:function(a,d,e){$("input[name='user_id']").val(a.dado.user_id),$("input[name='limite_auto_resposta']").val(a.dado.limite_auto_resposta),$("input[name='dias_auto_resposta']").val(a.dado.dias_auto_resposta),$("input[name='limite_atendentes']").val(a.dado.limite_atendentes),$("input[name='dias_login']").val(a.dado.dias_login),$("input[name='data']").val(a.dado.date),$("#loading2").modal("hide")},error:function(a,d,e){}}).fail(function(){$("#loading2").modal("hide"),alert("Tente mais tarde.")})};